import { BrowserRouter, Routes, Route } from "react-router-dom";
import "./App.css";
import Header from "./components/Header";
import Home from "./pages/Home";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <>
          <Route exact element={<Header />} />
          <Route path="/" element={<Home />} />
        </>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
